[application]

name="WildWitchEasterEgg1"
main_scene="res://cutscene00.scn"
icon="res://icon.png"
boot_logo=img(rgba, 0, 300, 230, )
boot_bg_color=#ff000c13
name_es="WildWitch"

[audio]

output_latency=24

[autoload]

playerdata="res://playerdata.gd"

[debug]

verbose_stdout=false

[display]

height=480
orientation="landscape"
stretch_2d=true

[display.Android]

driver="GLES2"

[display.iOS]

driver="GLES2"

[input]

move_left=[key(Left), key(A)]
move_right=[key(Right), key(D)]
move_up=[key(Up), key(W)]
move_down=[key(Down), key(S)]
magic_act=[key(Return)]
barra_espaco=[key(Space)]
esc_key=[key(Escape), jbutton(0, 11)]

[render]

mipmap_policy=1
